import SettingsIcon from '@mui/icons-material/Settings';

function App() {
  return (
    <div>
      <Button variant="text">Text</Button>
      <Button startIconvariant="contained" color="secondary" size="small">Contained</Button>
      <Button variant="outlined">Outlined</Button>
    </div>
  );
}

export default App;
